import React from "react";
import { List } from "antd";

class Tweet extends React.Component {
  render() {
    return (
      <List
        itemLayout="horizontal"
        dataSource={this.props.data}
        renderItem={item => (
          <List.Item>
            <List.Item.Meta
              title={<p>Tweet {item.id}</p>}
              description={item.content}
            />
          </List.Item>
        )}
      />
    );
  }
}

export default Tweet;
